import React from "react";
import { Link } from "react-router-dom";
import "./style.css";

function Nav() {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-success p-3">
      <a className="navbar-brand" href="/">
        Boomerang Books
      </a>
      <Link to="/" className="link">Search</Link>|
      <Link to="/saved"className="link">Saved Books</Link>

    </nav>
  );
}

export default Nav;
